## How to add your own commands

Add your commands in the [commands.json](./commands.json) file in your bot's root directory.

```json
{
  "commands": [
    {
      "command": "command",
      "description": "description",
      "execute": "execute",
      "example": "example"
    }
  ]
}
```

### Commands

- **command**: the command name that will be called in the discord server
- **description**: the command description that will be shown in the discord server
- **execute**: the function that will be called when the command is executed
- **example**: the command example that will be shown in the discord server

## How to add your own prompts

Add your prompts in the [prompts.json](./prompts.json) file in your bot's root directory.

```json
{
  "prompts": [
    {
      "prompt": "prompt",
      "description": "description",
      "example": "example"
    }
  ]
}
```

### Prompts

- **prompt**: the prompt name that will be called in the discord server
- **description**: the prompt description that will be shown in the discord server
- **example**: the prompt example that will be shown in the discord server

